        <div className="menu-item-text">
          <h3 className="menu-item-heading">
             <span className="menu-item-name">Greek Salad</span>
             <span className="menu-item-price">$12.99</span>
          </h3>
        </div>
        <button className="order-button-menu">Order</button>
      </div>
